class Solution {
  int minChanges(String s) {
    int change0 = 0, change1 = 0;
    for (int i = 0; i < s.length; i++) {
      if (i % 2 == 0) {
        if (s[i] == '0') change1++;
        else change0++;
      } else {
        if (s[i] == '1') change1++;
        else change0++;
      }
    }
    return Math.min(change0, change1);
  }
}
